import React from "react";
import Contacts from "./Contacts";
import BackButton from "./BackButton";

function About() {
    return (
        <div>
            <BackButton />

            {/* color #78b0a0 */}





            <div className="circuit-image1">
                <h1 className="text">Who am I?</h1>
            </div>

            <div className="avatar">
                <p className="text">
                    I'm an Electrical and Computer engineer who is
                    passionate about technology, and other problem solving
                    fields..
                </p>
            </div>

            <div className="circuit-image2"></div>

            <div className="carousel">
                <p className="text">
                    ..Additionally, I love facing new challenges, learning
                    about different cultures and sharing experiences
                    with others
                </p>
            </div>
            <div className="circuit-image3"></div>

            <Contacts />
        </div>
    );
}

export default About;
